0:56:28','2021-10-16 20:56:28'),(1078,'But it needs a name. Something sexy,\r\ninviting, and sophisticated.\r\n','1','Office Politics Trouble','06',142,'501','506','2021-10-16 20:56:28','2021-10-16 20:56:28'),(1079,'Glug.\r\n','1','Office Politics Trouble','06',143,'506','507','2021-10-16 20:56:28','2021-10-16 20:56:28'),(1080,'Yes! Erupt into a bev-rage\r\nthis summer with Glug.\r\n','1','Office Politics Trouble','06',144,'507','512','2021-10-16 20:56:28','2021-10-16 20:56:28'),(1081,'That\'s the slogan. We\'ll add\r\nthe word \'\'dawg\'\' for the blacks.\r\n','1','Office Politics Trouble','06',145,'512','515','2021-10-16 20:56:28','2021-10-16 20:56:28'),(1082,'They like that word,\r\nlike they\'re friends with the product.\r\n','1','Office Politics Trouble','06',146,'515','518','2021-10-16 20:56:28','2021-10-16 20:56:28'),(1083,'And so Dan Halen flooded\r\nthe market with Early\'s Glug.\r\n','1','Office Politics Trouble','06',147,'521','525','2021-10-16 20:56:28','2021-10-16 20:56:28'),(1084,'Welcome, y\'all.\r\nCome on in and get your Glug on.\r\n','1','Office Politics Trouble','06',148,'527','530','2021-10-16 20:56:28','2021-10-16 20:56:28'),(1085,'Leave your money on the counter.\r\nl trust you.\r\n','1','Office Politics Trouble','06',149,'530','533','2021-10-16 20:56:28','2021-10-16 20:56:28'),(1086,'And the region was cast in darkness.\r\n','1','Office Politics Trouble','06',150,'533','536','2021-10-16 20:56:28','2021-10-16 20:56:28'),(1087,'Affordable, refreshing,\r\nbrain-suffocating darkness.\r\n','1','Office Politics Trouble','06',151,'536','539','2021-10-16 20:56:28','2021-10-16 20:56:28'),(1088,'Russell, get the hell in my hands\r\nwhere l can see you.\r\n','1','Office Politics Trouble','06',152,'539','542','2021-10-16 20:56:28','2021-10-16 20:56:28'),(1089,'What did l tell you\r\nabout drinking underneath the age?\r\n','1','Office Politics Trouble','06',153,'543','547','2021-10-16 20:56:28','2021-10-16 20:56:28'),(1090,'You said if l could afford\r\nand bring back enough for you...\r\n','1','Office Politics Trouble','06',154,'547','550','2021-10-16 20:56:28','2021-10-16 20:56:28'),(1091,'you don\'t care what l do, and it\'s my body\r\nand l can kill it however l want to.\r\n','1','Office Politics Trouble','06',155,'550','553','2021-10-16 20:56:28','2021-10-16 20:56:28'),(1092,'And America\'s about freedom.\r\n','1','Office Politics Trouble','06',156,'553','556','2021-10-16 20:56:28','2021-10-16 20:56:28'),(1093,'Son, there\'s every chance in the world\r\nl was drunk when l said that?\r\n','1','Office Politics Trouble','06',157,'556','559','2021-10-16 20:56:28','2021-10-16 20:56:28'),(1094,'lt\'s your welfare l care about.\r\n','1','Office Politics Trouble','06',158,'559','561','2021-10-16 20:56:28','2021-10-16 20:56:28'),(1095,'You know that check?\r\nDid that come today?\r\n','1','Office Politics Trouble','06',159,'562','565','2021-10-16 20:56:28','2021-10-16 20:56:28'),(1096,'- l ain\'t seen the mail.\r\n- l knew you been drinking.\r\n','1','Office Politics Trouble','06',160,'565','568','2021-10-16 20:56:28','2021-10-16 20:56:28'),(1097,'Don\'t hurt me, Rusty!\r\n','1','Office Politics Trouble','06',161,'568','569','2021-10-16 20:56:28','2021-10-16 20:56:28'),(1098,'- Get back here.\r\n- ls that Rusty?\r\n','1','Office Politics Trouble','06',162,'569','572','2021-10-16 20:56:28','2021-10-16 20:56:28'),(1099,'- Get your Glug on.\r\n- Get the stuff.\r\n','1','Office Politics Trouble','06',163,'574','576','2021-10-16 20:56:28','2021-10-16 20:56:28'),(1100,'Cash your Glug points\r\nfor hats, coolers...\r\n','1','Office Politics Trouble','06',164,'576','579','2021-10-16 20:56:28','2021-10-16 20:56:28'),(1101,'canes, seeing-eye dogs,\r\nbooks on tape.\r\n','1','Office Politics Trouble','06',165,'579','582','2021-10-16 20:56:28','2021-10-16 20:56:28'),(1102,'The audio phone book, A-L,\r\nas read by Dan Halen.\r\n','1','Office Politics Trouble','06',166,'582','586','2021-10-16 20:56:28','2021-10-16 20:56:28'),(1103,'Ch